import React from 'react';
import {useState} from 'react';
import './App.css';

function App() {
  return (
    <div>
	<table>
		<tr>
			<th>September in 2022</th>
			<th>October in 2022</th>
			<th>November in 2022</th>
			<th>December in 2022</th>
			<th>January in 2023</th>
			<th>February in 2023</th>
			<th>March in 2023</th>
		</tr>
	</table>
    </div>
  );
}

export default App;
